void PageBroadcastAsyncWaiter::SetPageLifecycleState(PageLifecycleStatePtr state, PageRestoreParamsPtr page_restore_params)
{
    base::RunLoop loop;
    proxy_->SetPageLifecycleState(std::move(state), std::move(page_restore_params), base::BindOnce([](base::RunLoop* loop) { loop->Quit(); }, &loop));
    loop.Run();
}

void PageBroadcastAsyncWaiter::ActivatePrerenderedPage(PrerenderPageActivationParamsPtr prerender_page_activation_params)
{
    base::RunLoop loop;
    proxy_->ActivatePrerenderedPage(std::move(prerender_page_activation_params), base::BindOnce([](base::RunLoop* loop) { loop->Quit(); }, &loop));
    loop.Run();
}

